import React, { Component } from 'react'
import styled from 'styled-components'

const Wrapper = styled.div`
  background: red;
  width: 100px;
  height: 100px;
  display: flex;
  align-items: center;
  justify-content: center;
`

const Font = styled.i`
  font-family: 'Font Awesome Light';
  font-size: 5rem;

  &:before {
    content: '\f19d';
  }
`

class Icon extends Component {
  render() {
    return (
      <Wrapper>
        <Font />
      </Wrapper>
    )
  }
}

export default Icon
